import React from 'react'

export default function MyDate() {
    return (
        <div>
            <div className='item' >
                {/* 日期容器 */}
                <div className='date'>
                    <div className='month'>四月</div>
                    <div className='day'>19</div>
                </div>
            </div>
        </div>
    )
}
